package com.example.auta.domain.entities;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.time.LocalDate;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class ReturnEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    @ManyToOne    private EmployeeEntity employee;    private LocalDate rentalEndDate;    @OneToOne    private ReservationEntity reservation;    private BigDecimal extraPayment;    private Integer endMileage;}